import React, { useState, useEffect } from 'react';

function Game_Grid(){
    const [boxLimit, setBoxLimit] = useState([]);

    useEffect(()=> {
        const arr =[];
        for(let i=0; i< 60; i++){
            arr[i]=i;
        }
        setBoxLimit(arr);
    },[])

    return (
        <div>
            <div className="ui_grid">
            {boxLimit.map(box => <div className="box" key ={box}>{box}</div>)}
        </div>
        </div>
        
    );
}


export default Game_Grid;
